  function zoomed() {
    if (d3.event.sourceEvent && d3.event.sourceEvent.type === "brush") return; // ignore zoom-by-brush
    var t = d3.event.transform;
    x.domain(t.rescaleX(x2).domain());
    Line_chart.selectAll("path").attr("d",line);
    focus.select(".axis--x").call(xAxis);
    Harmonic_Frequencies.selectAll("line[class*=HarmonicFreqLine]")
              .attr("x1", function(d) { return x(d); })
              .attr("y1", 25)
              .attr("x2", function(d) { return x(d); }) 
              .attr("y2", height);
    svg.selectAll("rect[class*=HarmonicFreqTip]")
              .attr("transform", function(d) { return x(d) > 0 ? "translate(" + x(d) + "," + margin.top + ")" : "translate(" + (margin.left - 150) + "," + margin.top + ")"; } );
              
    svg.selectAll("text[class*=HarmonicFreqText]")
              .attr('x', function(d) { return x(d) > 0 ? x(d) + 30 : (margin.left - 150); });
  }
  
   
  
